●Terzoのフットとバーを車体に取り付けるための車種別ホルダー、取付パーツセット EH161<br>●様々な車のボディに合わせた専用設計で、特殊コーティングにより高い耐久性と車のボディやドアパッキンの損傷を防止します<br><br>☆ベースキャリア用オプション ラインアップ<br>保護シート(4枚入り) → ルーフオン用(170×70cm) EA19 / ルーフレール用(150×120cm) EA19R<br>ロックノブ(4個入り) → EA63<br>キーシリンダーセット(4個セット) → EA59<br>バーエンドキャップ(4個セット) → EA81<br>アシストバーパーツセット → EX13P<br>アシストバー → EX13<br><br>注1.車種専用設計のため、適合についてはメーカーHPの適用表をご確認下さい。<br>注2.車種により部品内容は異なります。<br>注3.車種タイプによっては使用しない場合があります。<style type="text/css">
